ign=\"center\">\r\n	<span style=\"font-family:宋体;\">到底好在哪里呢？</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span> </span> \r\n</p>\r\n<table align=\"left\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"21\" height=\"13\">\r\n				<br />\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n			</td>\r\n			<td style=\"border:.75pt solid black;vertical-align:top;background:white;\" width=\"543\" height=\"82\" bgcolor=\"white\">\r\n				<span> \r\n				<table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td>\r\n								<div style=\"padding:4.35pt 7.95pt 4.35pt 7.95pt;\" class=\"shape\">\r\n									<p class=\"MsoNormal\">\r\n										<span style=\"font-family:宋体;\">我们对它的评价是：</span><span></span> \r\n									</p>\r\n									<p class=\"MsoNormal\">\r\n										<span style=\"font-family:宋体;\">不同于重庆辣子鸡直来直去的麻辣，贵州辣子鸡味道更加醇厚浓郁，入骨三分。秘制的糍粑辣椒在带来短促的刺激后，将产生更长久的回味。</span><span></span> \r\n									</p>\r\n								</div>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n</span>&nbsp;\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<span>&nbsp;</span> \r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<br />\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">对此</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">山东枣庄的鲁大师第一个不服</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">他挽起袖子操起刀</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">分分钟端出了拿手好菜</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span><img src=\"file://C:\\Users\\杨\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image011.png\" width=\"421\" height=\"334\" border=\"0\" /></span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“请您来介绍一下山东辣子鸡的特色”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“大音希声，大象无形”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">我们瞬间懵逼</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span><img src=\"file://C:\\Users\\杨\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image012.jpg\" width=\"160\" height=\"88\" border=\"0\" /></span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“可以……说的详细一点……吗？”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“最简单的做法才能做出最本真的味道啊摔！”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">说完，大师拂袖而去</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span><img src=\"file://C:\\Users\\杨\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image014.jpg\" width=\"173\" height=\"160\" border=\"0\" /><img src=\"file://C:\\Users\\杨\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image016.jpg\" width=\"171\" height=\"160\" border=\"0\" /></span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">好好好</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">既然你这么厉害</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">那我们必须请出家住朝阳区的色魔张大妈了</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">张大妈看到这盘辣子鸡的一瞬间</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">脸色突然有点微妙的变化</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">她拿着筷子的手微微有点颤抖</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">尽管她竭力克制</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">可是</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">我们分明还是看到了她眼角泛起的泪光</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“大妈，您……”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“是老鲁的手艺吧，这么多年，还是没变”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">大妈放下筷子</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“这是家的味道啊”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span> </span> \r\n</p>\r\n<table align=\"left\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"37\" height=\"8\">\r\n				<br />\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n			</td>\r\n			<td style=\"border:.75pt solid black;vertical-align:top;background:white;\" width=\"543\" height=\"82\" bgcolor=\"white\">\r\n				<span> \r\n				<table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td>\r\n								<div style=\"padding:4.35pt 7.95pt 4.35pt 7.95pt;\" class=\"shape\">\r\n									<p class=\"MsoNormal\">\r\n										<span style=\"font-family:宋体;\">我们对山东辣子鸡的评价是：</span><span></span> \r\n									</p>\r\n									<p class=\"MsoNormal\">\r\n										<span style=\"font-family:宋体;\">确实，用最朴实的手法做出了家的味道。味道厚重，咸鲜香辣。</span><span></span> \r\n									</p>\r\n								</div>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n</span>&nbsp;\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<span>&nbsp;</span> \r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&